    private double[][] computeMatrix( Map<Long, double[][]> matrixMap) {
        double[][] matrix = new double[matrixMap.keySet().size()][400];
        int x = 0;
        for (Long key : matrixMap.keySet()){
            double[][] m = matrixMap.get(key);
            if(m.length + m[0].length >= matrix[0].length) {
                System.out.println("resize");
                //matrix = resizeMatrix(matrix, m.length + m[0].length);
            }


            for (int i = 0; i < m[0].length; i++) {
                for (int j = 0; j < m.length; j++) {
                    System.out.print(i + ", " + j + "| ");
                    matrix[x][(i * m.length) + j] = m[i][j];

                }
//                Matrix mContainer = new Matrix(m);
//                double[] eig = mContainer.eig().getRealEigenvalues();
//                for (int k = 0; k < eig.length; k++) {
//                    matrix[x][(i * m.length) + m[0].length] =
//                }
            }
            x++;
        }
        return matrix;

    }

    private double[][] resizeMatrix(double[][] matrix, int value) {
        int size = matrix.length + matrix[0].length + value;
        double[][] newMatrix = new double[size][size];

        for(int i = 0; i < matrix.length; i++){
            for (int j = 0; j < matrix[0].length; j++){
                newMatrix[i][j] = matrix[i][j];
            }
        }
        return newMatrix;
    }

